// src/components/Worker Dashboard/HeatStressMonitoringPage.js

import React from 'react';

const HeatStressMonitoringPage = () => {
  return (
    <div className="page-container">
      <h2>Heat Stress Monitoring</h2>
      <p>Keep track of your health.</p>
    </div>
  );
};

export default HeatStressMonitoringPage;
